import React from 'react'

function Test({user}) {
  return (
    <div>
      <img src= {user.file} alt="" />
      <h4>{user.id}</h4>
      <h4>{user.name}</h4>
      <h4>{user.city}</h4>
    </div>
  )
}

export default Test
